import { useEffect, useState } from 'react'

function Country() {
    const [countries, setCountries] = useState([]);


    useEffect(() => {
        fetch('https://restcountries.com/v3.1/all')
            .then(response => response.json())
            .then(res => setCountries(res))
    }, [])



    return (
        <div>
            <h1>Country</h1>

        </div>
    )
}

export default Country
